import axios from "axios";

const URL = 'https://travel-advisor.p.rapidapi.com/restaurants/list-in-boundary';

const options = {
  params: {
    bl_latitude: sw.lat,
    tr_latitude: ne.lat,
    bl_longitude: sw.lng,
    tr_longitude: ne.lng,
  },
  headers: {
    'x-rapidapi-key': 'deb7d45042msh2bb1b8af570064bp1f7b65jsn58f33f745665',
    'x-rapidapi-host': 'travel-advisor.p.rapidapi.com'
  }
};



export const getPlacesData = async(sw, ne) =>{
    try {
        const {data: {data}} = await axios.get(URL, {
          params: {
            bl_latitude: sw.lat,
            tr_latitude: ne.lat,
            bl_longitude: sw.lng,
            tr_longitude: ne.lng,
          },
          headers: {
            'x-rapidapi-key': 'deb7d45042msh2bb1b8af570064bp1f7b65jsn58f33f745665',
            'x-rapidapi-host': 'travel-advisor.p.rapidapi.com'
          }
        });
        return data;

    } catch (error) {
        console.log(error);
    }
}
